Sphere::Sphere(vec3 rgb, int shaderProgram) {
    this->rgb = rgb;
    this->shaderProgram = shaderProgram;
    this->initRotateM = glm::mat4(1.0f);
    this->rotateSelf = false; // initialize rotations around world axis
}
 
